	add("shikar", "{\"term\":\"shikar\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"Hindi\", \"Urdu\"], \"text\":\"From Urdu / Hindi \u0027شکار\u0027 / \u0027शिकार\u0027 from Persian \u0027شکار\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hunting, sport; a hunting expedition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027: Where other men took ten days to the Hills, Strickland took leave for what he called \u0027\u0027\u0027shikar\u0027\u0027\u0027, put on the disguise that appealed to him at the time, stepped down into the brown crowd, and was swallowed up for a while. — Rudyard Kipling, ‘Miss Youghal\u0027s \u0027Sais\u0027’, \u0027Plain Tales from the Hills\u0027 (Folio Society 2007, p. 25\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"hunting guide (elsewhere besides India, e.g. Australia\", \"priority\":3}]}, \"synonyms\":{}}");

