	add("shill", "{\"term\":\"shill\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{unk.|en}}; attested as verb 1914, as noun 1916.\u0026lt;ref\u0026gt;{{R:OED}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt; Perhaps an abbreviation of \u0027\u0027 () attested 1913. The word entered English via carny, originally denoting a carnival worker who pretends to be a member of the audience in an attempt to elicit interest in an attraction.Speculatively cognate with German \u0027schieber\u0027 (black marketeer, profiteer) via *\u0027\u0027 () \u0026lt;ref\u0026gt;Studies in the history of the English language II: unfolding conversations, by Anne Curzan, Kimberly Emmons, [http://books.google.com/books?id\u003dVWkfaTRQa5YC\u0026amp;pg\u003dPA90\u0026amp;dq\u003dShillaber page 90]\u0026lt;/ref\u0026gt;There are some suggestions that it originates in the surname Shilaber or Shillibeer, especially {{w|George Shillibeer}},\u0026lt;ref\u0026gt;The name\u0027s familiar II, by Laura Lee, [http://books.google.com/books?id\u003ddwf1YYxQmRsC\u0026amp;pg\u003dPA294\u0026amp;dq\u003d%22George+Shillibeer%22+shill page 294]\u0026lt;/ref\u0026gt; but proposed origins are dubious as the word is first attested in North America in the 20th century, while proposed models are 19th century British.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person paid to endorse a product favourably, while pretending to be impartial\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"26 June 2014\u0027\u0027, A.A Dowd, AV Club \u0027Paul Rudd and Amy Poehler spoof rom-com clichés in They Came Together\u0027[http://www.avclub.com/review/paul-rudd-and-amy-poehler-spoof-rom-com-cliches-th-206220\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You’ve Got Mail is certainly the basic model for the plot, which finds corporate candy \u0027\u0027shill\u0027\u0027 Joel (Rudd) and indie-sweetshop owner Molly (Poehler) regaling their dinner companions with the very long, digressive story of how they met and fell in love\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, w:Robert Anton Robert Anton Wilson, \u0027Prometheus Rising\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Witnesses have testified that Jim Jones (like a few other professional faith-healers) used \u0027\u0027shills\u0027\u0027 part of the time\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An accomplice at a confidence trick during an auction or gambling game\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, w:Cormac Cormac McCarthy, \u0027The Crossing\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The pitchman swept his cane in a slow acceleration over the heads of the crowd and then suddenly pointed the silver cap toward Billy and the \u0027\u0027shill\", \"priority\":8}]}, \"synonyms\":{}}");

