	add("shippon", "{\"term\":\"shippon\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\"], \"text\":\"Old english (ca. 450-1100) \u0027scypen\u0027 from Proto-germanic {{m|gem-pro|*skupinī}}, from {{m|gem-pro|*skup-}} (whence \u0027\u0027 . Cognate with German \u0027schuppen\u0027 (shed)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cattle-shed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, Vladimir Nabokov, \u0027Transparent Things\u0027, McGraw-Hill 1972, p. 51\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He almost reached the timberline – but there the weather changed, a damp fog enveloped him, and he spent a couple of hours shivering all alone in a smelly \u0027\u0027shippon\u0027\u0027, waiting for the whirling mists to uncover the sun once more\", \"priority\":3}]}, \"synonyms\":{}}");

	add("shipworm", "{\"term\":\"shipworm\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|ship|worm|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several wormlike marine mollusks (not true worms) of the family \u0027\u0027, that bore through the wooden hulls of ships and other woody material immersed in salt water\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027, w:Rachel Rachel Carson, \u0027The Edge of the Sea\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Old spars and water-soaked timbers cast on the beach are full of the workings of the \u0027\u0027shipworm\u0027\u0027—long cylindrical tunnels penetrating all parts of the wood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Erkki Leppäkoski, Stephan Gollasch, Sergej Olenin, \u0027Invasive Aquatic Species of Europe: Distribution, Impacts, and Management\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Even though mankind has tried to develop counter measures for thousands of years, still there is no easy solution to the \u0027\u0027shipworm\u0027\u0027 problem in sight\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Donald Launer, \u0027A Cruising Guide to New Jersey Waters\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In our waters, however, the \u0027\u0027shipworm\u0027\u0027 seldom attains a length of over a foot-and-a-half long\", \"priority\":7}]}, \"synonyms\":{}}");

	add("shipwreck", "{\"term\":\"shipwreck\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"scots\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027schip-wracke\u0027 from Old english (ca. 450-1100) \u0027scipwræc\u0027 (jetsam) equivalent to {{compound|ship|wrack|lang\u003den}}. Cognate with Scots \u0027schip-wrak\u0027 (to shipwreck) Swedish \u0027skeppsvrak\u0027 (shipwreck)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ship that has sunk or run aground so that it is no longer seaworthy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An event where a ship sinks or runs aground\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"destruction; ruin; irretrievable los\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bible, 1 Timothy 1. 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Holding faith and a good conscience, which some having put away concerning faith have made \u0027\u0027shipwreck\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"J. Morle\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It was upon an Indian bill that the late ministry \u0027\u0027had made shipwreck\", \"priority\":7}]}, \"synonyms\":{}}");

	add("shipwreckee", "{\"term\":\"shipwreckee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|shipwreck|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is shipwrecked\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027, Gregorio Marañón, Charles David Ley, \u0027Antonio Pérez, \u0026quot;Spanish Traitor\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Evidently his real charge was not to help Perez in his linguistic difficulties but to spy on him. But the malign \u0027\u0027shipwreckee\u0027\u0027 was at the same time a spy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, David Spedding, \u0027Shipwrecked International\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There is a chapter devoted to each \u0027\u0027shipwreckee\u0027\u0027, including their own photographs, drawings, cartoons, extracts from journals and other writings\", \"priority\":5}]}, \"synonyms\":{}}");

