	add("shirt", "{\"term\":\"shirt\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"{{PIE root|en|(s)ker}}From Old english (ca. 450-1100) {{m|ang|scyrte}}, from Proto-germanic {{m|gem-pro|*skurtijǭ}}. Cognate with Dutch {{m|nl|schort}}, German {{m|de|Schürze||apron}}. {{m|en|skirt|Skirt}} is a parallel formation from Old Norse; compare also {{m|en|short}}, from the same ultimate source.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An article of clothing that is worn on the upper part of the body, and often has sleeves, either long or short, that cover the arms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Several persons in December had nothing over their shoulders but their \u0027\u0027shirts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bishop Fishe\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She had her \u0027\u0027shirts\u0027\u0027 and girdles of hair\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"a member of the shirt-wearing team\", \"priority\":6}]}, \"synonyms\":{}}");

