	add("shirtfront", "{\"term\":\"shirtfront\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shirt|front|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The front part of a shirt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A detachable insert that simulates the front of a shirt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dI liked the man for his own sake, and even had he promised to turn out a celebrity it would have had no weight with me. I look upon notoriety with the same indifference as on the buttons on a man\u0027s \u0027\u0027shirt-front\u0027\u0027, or the crest on his note-paper\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A term used in cricket to refer to a pitch that is easy to bat on\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A head-on charge aimed at bumping an opponent to the ground\", \"priority\":5}]}, \"synonyms\":{}}");

