	add("shirttail", "{\"term\":\"shirttail\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shirt|tail|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The single or split (then rather plural) bottom part of a shirt, below the waist, especially in the back, which, when not tucked into trousers or other vestment, hangs over the wearer\u0027s tail-end, like a tail\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shisha", "{\"term\":\"shisha\", \"etymology\":{\"influencers\":[], \"languages\":[\"egyptian arabic\", \"English\", \"Persian\", \"Turkish\"], \"text\":\"From Egyptian arabic {{lang|und|sc\u003dArab|شيشة}} (šīša), from Turkish \u0027şişe\u0027 from Persian \u0027شیشه\u0027 (šīša) ‘glass’ or \u0027mirror\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Arabic water-pipe, or hookah\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The tobacco smoked in such a pipe, especially as mixed with molasses and flavour extract\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a type of embroidery which attaches small pieces of reflective metal to fabric\", \"priority\":3}]}, \"synonyms\":{}}");

	add("shito", "{\"term\":\"shito\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ga\"], \"text\":\"From Ga meaning \u0026quot;pepper\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spicy Ghanaian sauce made with seafood, tomatoes, garlic, peppers, and spices\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shitbum", "{\"term\":\"shitbum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shit|bum|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unclean, or otherwise undesirable person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Paul E. Doyle, \u0027Hot Shots and Heavy Hits: Tales of an Undercover Drug Agent\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;I ought to break your head, you asshole! You\u0027re a \u0027\u0027shitbum\u0027\u0027! You\u0027re scum! Do you understand that, boy? I wouldn\u0027t buy a fuckin\u0027 thing from you, you asshole!\u0026quot; I shouted, out of control\", \"priority\":3}]}, \"synonyms\":{}}");

	add("shitcan", "{\"term\":\"shitcan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027shit\u0027 () + \u0027can\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A garbage, rubbish, or trash container\", \"priority\":1}]}, \"synonyms\":{}}");

	add("shitehawk", "{\"term\":\"shitehawk\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shite|hawk|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large scavenging or predatory bird; especially (originally in military use in South Asia) the black kite\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dPossibly one of the most highly protected birds today is the kite, known by the British Army throughout the world as a shite-hawk\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shite-hawks..are more properly known as black kites,..gaining their unlovely nickname from British troops who used to get the meat stolen from their plates by these bold and skilful birds\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The European herring gull\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An objectionable person; a twat or wanker\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Valerie Maher, \u0027Sarah\u0027s Gate: Tales from Ballyhornet\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;Watch yer language, ye \u0027\u0027shitehawk\u0027\u0027.\u0026quot; His da had heard the din from the kitchen and had decided to have his say in the matter\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Gary Owen, \u0027Crazy Gary\u0027s Mobile Disco\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"What must it be like, to be such a fucking gimp, and see perfection, and know you\u0027re too much of a \u0027\u0027shitehawk\u0027\u0027 to ever have it\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Andrew M Greeley, \u0027The Priestly Sins\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"When I win, Liam still suggests on the eighteenth green that I\u0027m a nine-fingered \u0027\u0027shitehawk\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Chris Oakley, \u0027Football Delirium\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"any analyst who puts out a book with the word \u0026quot;ethics\u0026quot; in the title is invariably an incorrigible \u0027\u0027shitehawk\", \"priority\":13}]}, \"synonyms\":{}}");

	add("shitface", "{\"term\":\"shitface\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shit|face|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a contemptible person\", \"priority\":1}]}, \"synonyms\":{}}");

