	add("shithead", "{\"term\":\"shithead\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shit|head|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stupid or contemptible person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Unfortunately Todd is a dummy, but what\u0027s worse is that Harvey is a \u0027shithead\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A card game, the aim of which is to lose one\u0027s cards\", \"priority\":3}]}, \"synonyms\":{}}");

