	add("shitkicker", "{\"term\":\"shitkicker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shit|kicker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A workboot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A poor, rural person, especially from the southern United States\", \"priority\":2}]}, \"synonyms\":{}}");

