	add("shitload", "{\"term\":\"shitload\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shit|load|tr1\u003dlarge amount|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large amount\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, w:Robert Robert Zemeckis \u0026amp; w:Bob Bob Gale, \u0027w:Used Used Cars\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Roy Fuchs’ Assistant:\u0027 I just heard there\u0027s a \u0027\u0027shitload\u0027\u0027 of used cars coming this way\", \"priority\":3}]}, \"synonyms\":{\"list\":[{\"text\":\"buttload\", \"synonymQualifier\":\"VULGAR\"},{\"text\":\"crapload\", \"synonymQualifier\":\"VULGAR\"},{\"text\":\"fuckload\", \"synonymQualifier\":\"VULGAR\"}]}}");

