	add("shitstorm", "{\"term\":\"shitstorm\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shit|storm|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A violent situation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1948\u0027\u0027. Norman Mailer, \u0027The Naked and the Dead\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The hell with Brown [...] He\u0027s been missing all the \u0027\u0027shit storms\u0027\u0027. It\u0027s his turn\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027. Kurt Vonnegut, \u0027Cat\u0027s Cradle\u0027, Chapter 11\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Sometimes the \u0027pool-pah\u0027,\u0027 Bokonon tells us, \u0027exceeds the power of humans to comment.\u0027 Bokonon translates \u0027pool-pah\u0027 at one point in \u0027The Books of Bokonon\u0027 as \u0027\u0027shit storm\u0027\u0027 and at another point as \u0027wrath of God\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Joseph Finder, \u0027High Crimes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;You and your cowboys just stirred up a \u0027\u0027shitstorm\u0027\u0027, agent.\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, David Simon, \u0027Homicide: A Year on the Killing Streets\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In Baltimore, the general rule is that if something looks like a \u0027\u0027shitstorm\u0027\u0027, smells like a \u0027\u0027shitstorm\u0027\u0027 and tastes like a \u0027\u0027shitstorm\u0027\u0027, it goes to homicide\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Considerable backlash from the public\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Mungo MacCallum, \u0027The Monthly\u0027, April 2010, Issue 55, The Monthly Ptd Ltd, page 32\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"When Abbott stated openly that his plan involved a new tax of 1.7% on large companies with big profit margins - those, in fact, most able to pay - he provoked a near universal \u0027\u0027shitstorm\", \"priority\":12}]}, \"synonyms\":{}}");

	add("shittery", "{\"term\":\"shittery\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|shit|ery|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Anything bad or worthless\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Charlie Brooker, \u0027The Hell of it All\u0027 (page 253\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Of course, if you want to be on the receiving end of this kind of point-and-giggle \u0027\u0027shittery\u0027\u0027 it helps if you\u0027re a woman, and you\u0027ve had your crotch flashed across the internet courtesy of some clammy paparazzo\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Eva Darrows, \u0027The Awesome\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The sole good thing about the morning\u0027s \u0027\u0027shittery\u0027\u0027 was that Mom\u0027s concern for my wellbeing trumped last night\u0027s argument\", \"priority\":5}]}, \"synonyms\":{}}");

	add("shitton", "{\"term\":\"shitton\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|shit|ton|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An enormous amount; a fuckload\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027 October 26, \u0026quot;daniel federman\u0026quot; (username), \u0026quot;[http://groups.google.com/group/rec.arts.movies/msg/8877f580ebbb7d61?q\u003dshitton Re: PULP FICTION BOX OFFICE RESULTS?]\u0026quot;, in \u0026lt;tt\u0026gt;rec.arts.movies\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Most megahits cost a \u0027\u0027shitton\u0027\u0027 to produce, but Pulp Fiction was only 12 million dollars, according to Rolling Stone\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027 July 13, \u0026quot;jkeeton\u0026quot; (username), \u0026quot;[http://groups.google.com/group/alt.umr.student.babble/msg/0c5bfbc0c5768c1a?q\u003dshitton Current Events in St. Louis. *LONG*]\u0026quot;, in \u0026lt;tt\u0026gt;alt.umr.student.babble\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"How do they expect that by preventing a \u0027\u0027shitton\u0027\u0027 of rich honkies from going home will gain support for their cause\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Brian Costello, \u0027The Enchanters Vs. Sprawlburg Springs\u0027, Featherproof Books, ISBN 978-0-9771992-0-4, [http://books.google.com/books?id\u003dYTK5Ny9IjfcC\u0026amp;pg\u003dPA109\u0026amp;dq\u003dShitton page 109\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"These workdays were long, and through vicious wine hangovers, exhaustion, dehydration, and ringing ears, I tried learning how to make \u0027\u0027Shitton\u0027\u0027 of Meat Sandwiches. \u0026amp;para; Sometimes, I got it right; other times, I\u0027d forget to put on necessities like the cheese, and, on more than one occasion, the \u0027\u0027Shitton\u0027\u0027 of Meat\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 October 14, \u0026quot;Aeire\u0026quot;, [http://www.queenofwands.net/d/20051014.html commentary on the 2004 January 14 \u0027Queen of Wands\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"No, I\u0027m not poly. I have a \u0027\u0027shitton\u0027\u0027 of friends who are however, and it\u0027s one of those \u0027alternative lifestyles\u0027 (if you want to call it that I suppose) that people rarely hear about\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 January 27, \u0026quot;eric gisse\u0026quot; (username), \u0026quot;[http://groups.google.com/group/sci.astro/msg/389a3562deaadc46?q\u003dshitton Supermassive black hole rotation \u0026amp; host galaxy rotation]\u0026quot;, in \u0026lt;tt\u0026gt;sci.astro\u0026lt;/tt\u0026gt; and other newsgroups, \u0027Usenet\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A few billion years of local perturbations add up to a \u0027\u0027shitton\u0027\u0027 more effect than can be mounted against the overall galaxy\", \"priority\":11}]}, \"synonyms\":{}}");

