	add("shiva", "{\"term\":\"shiva\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Sanskrit\"], \"text\":\"From Sanskrit \u0027sc\u003ddeva|शिव|tr\u003dśivá\u0027 (the auspicious one)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The god of destruction and transformation, and together with Brahma and Vishnu, one of the principal deities in Hinduism. Within Shaivism he is viewed as the Supreme deity, whereas in other branches of Hinduism such as the Smarta tradition he is worshipped as one of the six manifestations of the Divine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"used in India\", \"priority\":2}]}, \"synonyms\":{}}");

